  false,\n\t\"url\": null,\n\t\"notes\": \"The Office of Coast Survey's Wrecks and
  Obstructions database contains information on the identified submerged wrecks and
  obstructions within the U.S. maritime boundaries. The data includes the position
  of each feature (latitude and longitude) along with a brief description. Information
  to populate the database comes from what is currently available on the electronic
  navigational chart (ENC) and Coast Survey's Automated Wrecks and Obstructions Information
  System (AWOIS) database. \",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
